import React, { Component } from "react";
import {Button, Col, ListGroup, ListGroupItem, Media, Row} from "reactstrap";
import {faStar, faUser } from "@fortawesome/free-solid-svg-icons";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import styles from "./MediaElement.module.css";
import classnames from "classnames";
import {updateObject} from "../../../shared/utility";

class MediaElement extends Component {
  constructor(props) {
    super(props);
    this.selectPhysician.bind(this);
  };

  componentDidMount() {
  }
  
  // click handler for physician selection
  selectPhysician = (pid, clinicid) => {
    this.props.onGetPhysicianById(pid, clinicid);
    // updateObject(this.props.appointmentData, {phyname, clinicname, pt_price, pid, clinicid, clinicaddress, cliniccontact, specializations, cityname });
    console.log(this.props.physicianDetails);
    for (const key of [phyname, clinicname, pt_price, clinicaddress, cliniccontact, specializations, cityname]) {
      this.props.appointmentData.append(key, this.props.physicianDetails[key]);
    }
    console.log(this.props.appointmentData);
    // this.props.appointmentData.pid = pid;
    // this.props.appointmentData.clinicid = clinicid;
    // this.props.appointmentData.consultfee = pt_price;
    this.props.onSelectPhysician(pid, clinicid, pt_price);
    this.props.onSetAppointmentData(this.props.appointmentData);
  };
  render() {
    const noOfStars = this.props.noOfStars;
    const panelData = this.props.record;
    let starIconArray = [];
    for (let i = 0; i < noOfStars; i++) {
      starIconArray[i] = (
        <FontAwesomeIcon key={"star" + i} color="#D88D37" size="1x" icon={faStar}/>
      );
    }
    return (
      <Media className={classnames(styles.mediaElement, "m-1", "p-1")}>
        <Media left top href="#">
          {/*} <Media object data-src="holder.js/64x64" alt="Generic placeholder image" />*/}
          <div className="text-center">
            <FontAwesomeIcon color="#ccc" size="5x" icon={faUser}/>
          </div>
          <div>{starIconArray}</div>
          <Button className="pt-0" color="link" onClick={this.selectPhysician.bind(null, panelData.id, panelData.clinicid)}>
            Select
          </Button>
        </Media>
        <Media body>
          <ListGroup flush className="ml-3">
            <ListGroupItem className="border-0 p-0">
              <Row>
                <Col md="5" className={classnames(styles.widthHalf, "font-weight-bold", "pr-1")}>
                  Name
                </Col>
                <Col md="7" className={classnames(styles.widthHalf, "pl-1")}>
                  {panelData.phyname}
                </Col>
              </Row>
            </ListGroupItem>
            <ListGroupItem className="border-0 p-0">
              <Row>
                <Col className={classnames(styles.widthHalf, "font-weight-bold", "pr-1")} md="5">
                  Specializations
                </Col>
                <Col md="7" className={classnames(styles.widthHalf, "pl-1")}>
                  {panelData.specializations}
                </Col>
              </Row>
            </ListGroupItem>
            <ListGroupItem className="border-0 p-0">
              <Row>
                <Col className={classnames(styles.widthHalf, "font-weight-bold", "pr-1")} md="5">
                  Practicing since
                </Col>
                <Col md="7" className={classnames(styles.widthHalf, "pl-1")}>
                  {panelData.experience}
                </Col>
              </Row>
            </ListGroupItem>
            <ListGroupItem className="border-0 p-0">
              <Row>
                <Col className={classnames(styles.widthHalf, "font-weight-bold", "pr-1")} md="5">
                  Consult at
                </Col>
                <Col md="7" className={classnames(styles.widthHalf, "pl-1")}>
                  {panelData.clinicname}
                </Col>
              </Row>
            </ListGroupItem>
          </ListGroup>
        </Media>
      </Media>
    );
  };
}

export default MediaElement;
